{% block specificJs %}{{ parent() }}

{% endblock specificJs %}
        


{% block container %}
        
<div id=\"content\">
    <div id=\"content-header\">
        <h1 id=\"titre_help\">Notifications management</h1>         
        <div id=\"description_help\">Here, you can change the person who you want to alert in case of script success or failure</div>
    </div>
    
    {{ form_start(form, {'attr': {'class': 'form-horizontal'}} ) }}
    {{ form_errors(form) }}
        
    <div class=\"row\">
        <div class=\"col-xs-12\">
            {{ macros.wizz() }}
        </div>
        
        <div class=\"col-xs-12\">
            <div class=\"widget-box\">
                <div class=\"widget-title\">
                    <span class=\"icon\">
                        <i class=\"icon-th\"></i>
                    </span>
                    <h5>List of email address to notify</h5>
                </div>
                <div class=\"widget-content nopadding\">
                    <div class=\"form-group\">
                        <label class=\"control-label\">{{ form_label(form.parameterValue) }} :</label>
                        <div class=\"controls\">
                            {{ form_widget(form.parameterValue, { 'attr': {'class': 'form-control'} }) }}
                        </div>
                    </div> 
                    <div class=\"form-actions\">
                        <input type=\"submit\" class=\"btn btn-primary\" />
                    </div>
                </div>
            </div>
        </div>           
    </div>

